    <Box sx={{ p: 2 }}>
      <Typography variant="h4" gutterBottom>
        Détails pour : {championName}
      </Typography>
      {/* Ici, intègre la structure et les composants de la page de détails du champion */}
      {/* Par exemple, tu pourras insérer les composants comme ButtonHome, ChampionHeader, etc. */}
    </Box>
  );
};

